function AddValidator(){if($("#username_add").val()==""){$.messager.alert("提示","姓名不能为空");return false}if($("#iphone_add").val()==""){$.messager.alert("提示","电话不能为空");return false}if($("#num_add").val()==""){$.messager.alert("提示","数量不能为空");return false}return true}function ordersubmitForm(){if(AddValidator()){var a={"username":$("#username_add").val(),"iphone":$("#iphone_add").val(),"address":$("#address_add").val(),"num":$("#num_add").val(),"orgname":$("#orgname_add").val(),"orgstatus":"1"};console.log(a);$.ajax({url:ws_url+"/rest/order/insertorders?token="+gtoken,contentType:"application/json;charset=UTF-8",type:"post",datatype:"json",data:JSON.stringify(a),cache:false,success:function(b){console.log(b.status);console.log(b.message);$("#form1").form("clear");if(b.status=="success"){$.messager.alert("提示","添加成功！","info",function(){$("#orderadd").window("close");$("#ordergrid").datagrid("reload")})}else{if(b.status=="failure"){if(b.message=="Order num is maxnum"){$.messager.alert("提示","提交订单数超出了当天最大限制数,请联系平台管理员！","warning",function(){$("#orderadd").window("close");$("#ordergrid").datagrid("reload")})}else{$.messager.alert("提示","添加失败！","error",function(){$("#orderadd").window("close");$("#ordergrid").datagrid("reload")})}}}},error:function(b){console.log(b)}})}};